import React, { useState } from 'react';
import './SadOMeterPage.css'; // Reuse styles for consistency
import ScoreMeter from './ScoreMeter';
import GaugeScoreMeter from './GaugeScoreMeter';
import './GaugeScoreMeter.css';

const questions = [
  {
    text: 'How frequently do you feel overwhelmed by daily tasks?',
    type: 'scale',
    options: ['Never', 'Rarely', 'Sometimes', 'Often', 'Very Often']
  },
  {
    text: 'Do you find yourself snapping at others?',
    type: 'mcq',
    options: ['Yes', 'No', 'Sometimes']
  },
  {
    text: 'How well do you handle unexpected changes in routine?',
    type: 'mcq',
    options: ['Very Well', 'Okay', 'Not Well', 'Terribly']
  },
  {
    text: 'Do you feel tense or on edge most of the time?',
    type: 'scale',
    options: ['Never', 'Rarely', 'Sometimes', 'Often', 'Very Often']
  },
  {
    text: 'How often do you feel you have too much to do and too little time?',
    type: 'scale',
    options: ['Never', 'Rarely', 'Sometimes', 'Often', 'Very Often']
  },
  {
    text: 'Do you use any coping strategies for stress?',
    type: 'mcq',
    options: ['Yes', 'No', 'Sometimes']
  }
];

const emojiReactions = ['üòê', 'üò¨', 'üò£', 'üòñ', 'üò±'];

export default function StressOMeterPage() {
  const [step, setStep] = useState(0);
  const [answers, setAnswers] = useState([]);
  const [score, setScore] = useState(null);
  const [result, setResult] = useState('');
  const [loading, setLoading] = useState(false);
  const [showBreak, setShowBreak] = useState(false);

  const handleAnswer = (val) => {
    setAnswers(a => [...a, val]);
    if ((step + 1) % 3 === 0 && step !== questions.length - 1) {
      setShowBreak(true);
    } else {
      setStep(s => s + 1);
    }
  };

  const handleContinue = () => {
    setShowBreak(false);
    setStep(s => s + 1);
  };

  const handleSubmit = async () => {
    setLoading(true);
    setResult('');
    setScore(null);
    try {
      const res = await fetch('/api/mental-health-predict', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          questions: questions.map(q => q.text),
          answers
        })
      });
      const data = await res.json();
      const match = data.result.match(/score is (\d{1,3})/i);
      let scoreVal = match ? parseInt(match[1]) : null;
      if (scoreVal === null || isNaN(scoreVal)) scoreVal = 60;
      setScore(scoreVal);
      setResult(data.result);
    } catch (e) {
      setResult('Error: ' + e.message);
    }
    setLoading(false);
  };

  // Animated emoji based on step
  const emoji = emojiReactions[Math.min(Math.floor((step / questions.length) * emojiReactions.length), emojiReactions.length - 1)];

  return (
    <div className="sadometer-root">
      <h2 style={{marginBottom: 0}}>Stress-O-Meter <span style={{fontSize: 28}}>{emoji}</span></h2>
      <div className="sadometer-progress-bar">
        <div className="sadometer-progress" style={{width: `${(step / questions.length) * 100}%`}} />
      </div>
      {score === null && step < questions.length && !showBreak && (
        <div className="sadometer-question-card">
          <div className="sadometer-question">{questions[step].text}</div>
          <div className="sadometer-options">
            {questions[step].options.map((opt, i) => (
              <button
                key={i}
                className="sadometer-option-btn"
                onClick={() => handleAnswer(opt)}
                disabled={loading}
              >
                {opt}
              </button>
            ))}
          </div>
        </div>
      )}
      {showBreak && (
        <div className="sadometer-break-card">
          <div style={{fontSize: 32, marginBottom: 12}}>üßò‚Äç‚ôÇÔ∏è Need a break?</div>
          <div style={{marginBottom: 16}}>Take a deep breath, stretch, or grab some water. Ready to continue?</div>
          <button className="sadometer-option-btn" onClick={handleContinue}>I‚Äôm Ready!</button>
        </div>
      )}
      {step === questions.length && score === null && !showBreak && (
        <div style={{marginTop: 24}}>
          <button className="feature-btn" onClick={handleSubmit} disabled={loading}>
            {loading ? 'Analyzing...' : 'See My Stress Score'}
          </button>
        </div>
      )}
      {score !== null && (
        <div style={{marginTop: 32}}>
          <GaugeScoreMeter score={score} label="Your Stress Score" goodIsHigh={false} />
          {result && <div style={{marginTop: 18, fontWeight: 600, color: '#4caf50'}}>{result}</div>}
        </div>
      )}
      <a href="/" className="feature-btn" style={{marginTop: 32, display: 'inline-block'}}>Back to Home</a>
      {/* Floating break prompt */}
      {step < questions.length && !showBreak && (
        <div className="sadometer-floating-break" onClick={() => setShowBreak(true)}>
          <span role="img" aria-label="break">üßò‚Äç‚ôÄÔ∏è</span> Need a break?
        </div>
      )}
    </div>
  );
}
